DROP TABLE IF EXISTS `bond`;
CREATE TABLE `bond` (
											`id` SMALLINT(11) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '数据表主键（自增ID）',
											`bond_key` VARCHAR(32) DEFAULT '' COMMENT 'bond_key',
											`bond_id` VARCHAR(16) DEFAULT '' COMMENT '债券代码',
											`bond_name` VARCHAR(255) DEFAULT '' COMMENT '债券名称',
											`listed_market` VARCHAR(32) DEFAULT '' COMMENT '发行市场',
											`planned_issue_start_date` DATE DEFAULT NULL COMMENT '计划发行开始日期',
											`planned_issue_end_date` DATE DEFAULT NULL COMMENT '计划发行结束日期',
											`issue_date` DATE DEFAULT NULL COMMENT '发行日期',
											`bond_type` VARCHAR(32) DEFAULT '' COMMENT '债券类型',
											`maturity_term` VARCHAR(128) DEFAULT '' COMMENT '期限,单位Y(年)、M(月)、D(天)',
											`issuer_code` VARCHAR(8) DEFAULT '' COMMENT '发行人编号',
											`issuer_name` VARCHAR(255) DEFAULT '' COMMENT '发行人名称',
											`issue_amount` VARCHAR(16) DEFAULT '' COMMENT '发行规模（亿）',
											`issuer_rating` VARCHAR(8) DEFAULT '' COMMENT '主体评级',
											`bond_rating` VARCHAR(8) DEFAULT '' COMMENT '债项评级',
											`rating_inst` VARCHAR(64) DEFAULT '' COMMENT '评级机构',
											`org_type` VARCHAR(16) DEFAULT '' COMMENT '企业类型',
											`coupon_rate` VARCHAR(8) DEFAULT '' COMMENT '上传的发行利率',
											`coupon_rate_upper_limit` VARCHAR(8) DEFAULT '' COMMENT '利率上区间',
											`coupon_rate_lower_limit` VARCHAR(8) DEFAULT '' COMMENT '利率下区间',
											`coupon_rate_update_date` DATETIME DEFAULT NULL COMMENT '利率上传时间',
											`coupon_rate_confirmed` INT(1) DEFAULT '0' COMMENT '标记上传的发行利率是否已确认, 0:未确认，1:已确认',
											`issue_cancel_flag` INT(1) DEFAULT '0' COMMENT '取消发行标志, 0:未取消, 1:取消发行',
											`industry` VARCHAR(16) DEFAULT '' COMMENT '行业',
											`issue_mode` VARCHAR(8) DEFAULT '' COMMENT '发行方式，私募或公募',
											`province` VARCHAR(8) DEFAULT '' COMMENT '省份',
											`issuer_pinyin` VARCHAR(255) DEFAULT '' COMMENT '发行人拼音，用于搜索',
											`bond_pinyin` VARCHAR(255) DEFAULT '' COMMENT '债券名称拼音，用于搜索',
											`result_source` VARCHAR(16) DEFAULT '' COMMENT '结果来源',
											`data_source` VARCHAR(16) DEFAULT '' COMMENT '数据来源',
											`del_flag` TINYINT(1) UNSIGNED NOT NULL DEFAULT '0' COMMENT '数据是否有效，0有效，1无效',
											`create_date` DATETIME DEFAULT CURRENT_TIMESTAMP COMMENT '数据创建时间',
											`modify_date` DATETIME DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '数据更新时间',
											PRIMARY KEY (`id`),
											KEY `select_key1` (`del_flag`,`bond_key`,`data_source`,`modify_date`)
) ENGINE=INNODB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8 COMMENT='信用债信息表';

